import 'package:flutter/material.dart';
import 'package:flutter_html/flutter_html.dart';
import '';
class HtmlScreen extends StatelessWidget {
  HtmlScreen({Key? key}) : super(key: key);
  String htmlData =r""" <html><head></head><body><p><img src="data:image/jpeg;base64,">
</p>
<p>&nbsp;</p>
<p>&nbsp;</p>
<p><iframe src="https://www.youtube.com/embed/9tCL0EW0MpM" width="560" height="314" allowfullscreen="allowfullscreen"></iframe></p>
<p>&nbsp;</p>
<p>&nbsp;</p>
<p><a href="https://www.google.com/">https://www.google.com/</a></p>
<p>&nbsp;</p>
<p>&nbsp;</p>
<p>هذا النص هو مثال لنص يمكن أن يستبدل في نفس المساحة، لقد تم توليد هذا النص من مولد النص العربى، حيث يمكنك أن تولد مثل
    هذا النص أو العديد من النصوص الأخرى إضافة إلى زيادة عدد الحروف التى يولدها التطبيق. إذا كنت تحتاج إلى عدد أكبر من
    الفقرات يتيح لك مولد النص العربى زيادة عدد الفقرات كما تريد، النص لن يبدو مقسما ولا يحوي أخطاء لغوية، مولد النص
    العربى مفيد لمصممي المواقع على وجه الخصوص، حيث يحتاج العميل فى كثير من الأحيان أن يطلع على صورة حقيقية لتصميم
    الموقع.</p></body></html> """;

  @override
  Widget build(BuildContext context) {
    return new Scaffold(
      appBar: AppBar(
        title: Text('flutter_html Example'),
        centerTitle: true,
      ),
      body: SingleChildScrollView(
        child: Center(
          child: Html(
            data: htmlData,
            tagsList: Html.tags..addAll(["bird", "flutter"]),
            style: {
              "table": Style(
                backgroundColor: Color.fromARGB(0x50, 0xee, 0xee, 0xee),
              ),
              "tr": Style(
                border: Border(bottom: BorderSide(color: Colors.grey)),
              ),
              "th": Style(
                padding: EdgeInsets.all(6),
                backgroundColor: Colors.grey,
              ),
              "td": Style(
                padding: EdgeInsets.all(6),
                alignment: Alignment.topLeft,
              ),
              'h5': Style(maxLines: 2, textOverflow: TextOverflow.ellipsis),
            },
            customRender: {
              "table": (context, child) {
                return SingleChildScrollView(
                  scrollDirection: Axis.horizontal,
                  child: (context.tree as TableLayoutElement).toWidget(context),
                );
              },
              "bird": (RenderContext context, Widget child) {
                return TextSpan(text: "🐦");
              },
              "flutter": (RenderContext context, Widget child) {
                return FlutterLogo(
                  style: (context.tree.element!.attributes['horizontal'] != null)
                      ? FlutterLogoStyle.horizontal
                      : FlutterLogoStyle.markOnly,
                  textColor: context.style.color!,
                  size: context.style.fontSize!.size! * 5,
                );
              },
            },
            customImageRenders: {
              networkSourceMatcher(domains: ["flutter.dev"]):
                  (context, attributes, element) {
                return FlutterLogo(size: 36);
              },
              networkSourceMatcher(domains: ["mydomain.com"]): networkImageRender(
                headers: {"Custom-Header": "some-value"},
                altWidget: (alt) => Text(alt ?? ""),
                loadingWidget: () => Text("Loading..."),
              ),
              // On relative paths starting with /wiki, prefix with a base url
              (attr, _) =>
                      attr["src"] != null && attr["src"]!.startsWith("/wiki"):
                  networkImageRender(
                      mapUrl: (url) => "https://upload.wikimedia.org" + url!),
              // Custom placeholder image for broken links
              networkSourceMatcher():
                  networkImageRender(altWidget: (_) => FlutterLogo()),
            },
            onLinkTap: (url, _, __, ___) {
              print("Opening $url...");
            },
            onImageTap: (src, _, __, ___) {
              print(src);
            },
            onImageError: (exception, stackTrace) {
              print(exception);
            },
            onCssParseError: (css, messages) {
              print("css that errored: $css");
              print("error messages:");
              messages.forEach((element) {
                print(element);
              });
            },
          ),
        ),
      ),
    );
  }
}
